import React, {Component} from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';


class App extends Component{


    render(){
        return(
            <div>
                <AppBar elevation={1}>
                    <Toolbar>
                        <Typography variant="h6">
                            Sam Kirby
                        </Typography>
                    </Toolbar>
                </AppBar>
            </div>
        )
    }
}


export default App
